import React from 'react';
import Routes from './Routes.js';
import { Provider } from 'react-redux';
import { store } from './store/store';
import 'bootstrap/dist/css/bootstrap.min.css';
import './style.css';

const App = () => {
  return (
  <Provider store={store}>
    <Routes />
  </Provider>
  )
};

export default App;
